import RendezvousFormulaire from "../../components/rdvFormulaire.jsx";

function Rendezvous() {
    return (
        <div className="rendezvous">
            <div className="bonjour">
                <p>Hey c'est rdv</p>
            </div>
            <RendezvousFormulaire/>
        </div>
    )
}

export default Rendezvous;
